e, and most important Program in the history of our nation’s education system.  The Project solves both the critical academic and economic problems that are failing our schools, students, and the nation.<br/>Visit our website, www.coderead.org, and please join us, as a member of our National Honorary Advisory Board.  Enter your email on our Home Page, and we will keep you updated and proud to be an integral part of bringing our students into the 21st Century Digital Education Age.  Then, please make a tax-deductible donation, if you can, to our nonprofit Organization.  All donations, both large and small, are critical to the success of our Campaign.  <br/>Most important, please copy and share our MESSAGE (below), with all your family, friends, and business contacts, through your personal emails and social media; and ask them to share this MESSAGE with all their email and social media contacts.<br/>Again, thank you for your interest and support, and please keep in touch.  All inputs are very much appreciated, as you are now an integral part of this amazing and exciting adventure, which will save our schools, and insure a brighter and more prosperous future for our students and the nation!<br/><br/>Most Sincerely Yours in the Education of our Children,<br/>Mike Bond<br/>mbond@coderead.org<br/><br/>AN EMAIL AND SOCIAL MEDIA MESSAGE FOR ALL AMERICANS<br/>Dear          ,<br/>A friend of a friend, a philanthropist, has created a Foundation that is revolutionizing our nation’s failing education system, by providing our schools, teachers, students, and parents FREE Interactive Multimedia Digital Education Technology Schoolbooks, which will change forever the way our students read, study, and learn.  Digital Education Technology is the simple and easy solution to capturing and holding the attention of our modern techno-savvy students, who are bored and frustrated with the lack of computer technology in their classrooms. Exciting and engaging Digital Schoolbooks will stimulate all students to remain in school and partner with their teachers in a new education adventure every day!  <br/>Visit the Digital Education Project Foundation website, www.coderead.org, and please join us, as a member of our National Honorary Advisory Board.  Enter your email on our Home Page, and we will keep you updated and proud to be an integral part of bringing our students into the 21st Century Digital Education Age. Then, please make a tax-deductible donation, if you can, to our nonprofit Organization.  All donations, large and small, are critical to the success of this Campaign. Your Federal Tax-Deduction Certificate Number is 46-3809122.<br/>Most important, please copy and share this email with all your family, friends, and business contacts, through your personal emails and social media; and, ask them to share this MESSAGE with all their email and social media contacts.   The Program needs the voices and support of all Americans to guarantee a brighter and more prosperous future for all our students and the nation. <br/>Sincerely Yours in the Education of our Children,',0,0,0,'2017-09-22 23:46:07',NULL),(1231,0,'ACoAAB-n_AgBJU3ZebLPYgx7kqbvvhiT7GUqjQM','6317071110319931392','I6317101069902188544_500',1,'this is a little more to it than and would benefit you',0,0,0,'2017-09-22 21:04:19',NULL),(1232,0,'ACoAAB2nPMkBLiRN9WA7vHrDkjpVTT3uubtPiWM','6313350241940750337','I6317355291436421120_500',0,'Great',0,0,1,'2017-09-23 13:54:30',NULL),(1233,1,'ACoAAB2nPMkBLiRN9WA7vHrDkjpVTT3uubtPiWM','6313350241940750337','S6317359217183322112_500',0,'Thank you very much!',1,0,1,'2017-09-23 14:10:09',NULL),(1234,1,'ACoAAAM5nMgB26NWk5fac2gbJgtBma_KtNu1rc0','6317360985518678016','S6317360985518678016_500',2,'Hi, I\'m Karina the director of partnerships at YouPic. I would like to open up a discussion regarding partnership with you. Think it could be beneficial for both. \\nLet me know if you are interested. \\nYours, \\nKarina',0,0,1,'2017-09-23 14:17:10','O:8:\"stdClass\":2:{s