5 million photographers worldwide. I would like to open up a discussion with you regarding partnership with you. <br/><br/>Let me know if you are interested. <br/><br/><br/><br/>Yours, Karina',0,0,1,'2017-02-16 22:21:50',NULL),(1764,0,'ACoAAAGhnL0Bt4jik6jOr9SXiu8lRoE0P8lvhdc','6238120023085457408','I6238120528440360960_500',0,'Dear Karina,<br/><br/>Thank you for reaching out to me about a possible partnership with YouPic. I\'m not familiar with the work that you do, but I am always interested in what\'s going on around the world, especially the world of photography! <br/><br/>I look forward to hearing more from you about your ideas.<br/><br/>All the best, <br/><br/>Patricia',0,0,0,'2017-02-16 22:23:51',NULL),(1765,1,'ACoAAAGhnL0Bt4jik6jOr9SXiu8lRoE0P8lvhdc','6238120023085457408','S6238123635282939904_500',0,'Great Patricia, thanks for being so positive. We are looking for a few ambassadors in their respective fields and offer mutual beneficial relationship as partner with YouPic. <br/><br/>Today we are sharing the knowledge of photography, connecting professionals with enthusiast and making it possible for professionals to gain customers and exposure. I suggest we customise the partnership based on your special demand and needs at the moment. <br/><br/>Basically we will have you featured on our website and apps and will promote your material/photos, work shops, projects, photo books, lessons and stories. <br/><br/>Would this be something worth trying and if so, in what areas do you think you can be an ambassador for? Yours, Karina',0,0,1,'2017-02-16 22:36:11',NULL),(1766,0,'ACoAAAGhnL0Bt4jik6jOr9SXiu8lRoE0P8lvhdc','6238120023085457408','I6238130871614996480_500',0,'Dear Karina,<br/><br/>I\'d like to know more about why you have contacted me in particular, and just what being an \\\"ambassador\\\" means, also in terms of a \\\"partner\\\" with YouPic. Is this a membership that you are seeking, or, as you said, profiling and featuring professionals to bring more interest to YouPic for enthusiasts? Is there a cost to me for being involved?<br/><br/>If I were to be an \\\"ambassador\\\" I would probably be interested in social justice projects, such as my current \\\"Erasing Lines\\\" about a local Drag Queen community and gender equity, and my upcoming portrait series about immigration/integration in southern Italy, \\\"Facing Ourselves\\\".  I also specialize in Holga film shooting, and have occasionally taught classes in using toy cameras; I have several projects on my website where that work can be seen. <br/><br/>I have traveled all over the world for the last 40 years, and can definitely come up with a lot of stories! <br/><br/>Out of curiosity, how did you find me?<br/><br/>Best, <br/><br/>Patricia',0,0,0,'2017-02-16 23:04:57',NULL),(1767,1,'ACoAAAGhnL0Bt4jik6jOr9SXiu8lRoE0P8lvhdc','6238120023085457408','S6238467236722458624_500',0,'Wow Patricia, you seem to be perfect for us. I simply found you via LinkedIn advanced search. With ambassador it means simple that we will promote you and your brand, and we would like to get the same back. Also you would get early access to new features and build the community together with us, giving us feedback and ideas. There is no cost to you and all can be done simply with a few clicks a day or per week. <br/><br/>Can we try to schedule a call with our CEO to get things more detailed? Would be great if you could sign up on YouPic, upload a photo to feel the community out before the call.',0,0,1,'2017-02-17 21:21:32',NULL),(1768,0,'ACoAAAGhnL0Bt4jik6jOr9SXiu8lRoE0P8lvhdc','6238120023085457408','I6239259735544201216_500',0,'Dear Karina,<br/><br/>Thank you for your kind response and the information about how you made contact with me. I have uploaded a photograph (pcphotog) which you can now view. Please let me know when you would like to schedule a conversation with your CEO so that I can be more fully informed about our mutual commitment. Perhaps you can send me an example of another ambass