L),(2050,0,'ACoAAA97_XsBNbPARmtGLpGuHnbhMzNulvJJdqQ','6238031323768848384','I6238067016578658304_500',0,'Karina,<br/>Yes, this would absolutely be something of interest for me. I really specialize in the fine art side of photography and do a lot of gallery showing, have work in museum collections, etc. and this would include areas like fine art printing in both a digital and darkroom environment, digital fine art workflow from capture through editing to final print, photoshop and digital image manipulation and probably most importantly creative direction as it relates to studio photography as my current and in process body of work entitled \\\"Anahata\\\" has been a collaborative process with professional dancers, theatre performers, costume designers, make-up, etc. approaching the medium from a much more cinematic perspective and managing crews of about fifteen or more people on set in the service of bringing a certain vision or idea to fruition and the myriad of challenges as well as exciting aspects that come along with successfully executing this type of work. <br/><br/>I have a show of this work coming up in Philadelphia, PA in May in which the work will be displayed on OLED panels in a dark immersive space with originally composed music and I feel like one of the things that\'s exciting to me about the medium of photography is one\'s ability to create an image and realize each photographer\'s unique vision using the tools of the studio as opposed to relying on the traditional notion of \\\"taking a picture\\\" or relying on the external world to provide material to photograph. I just feel like the issue is that many photographers don\'t know where to start in regard to thinking and working this way. I see a lot of very talented photographers that are a bit intimidated when it comes to entering into the \\\"fine art\\\" world, approaching galleries and see success in this regard as an unattainable thing when it\'s really not. <br/><br/>I see in your profile you are located in Sweden, would you like to find a time to speak via phone or Skype and discuss what a mutually beneficial and productive working relationship between us could potentially look like?<br/>Best,<br/><br/>-John',0,0,0,'2017-02-16 18:51:12',NULL),(2051,0,'ACoAAA97_XsBNbPARmtGLpGuHnbhMzNulvJJdqQ','6238031323768848384','I6238138082860900352_500',0,'Karina,<br/>Wonderful! I look forward to speaking with him, thanks you getting in touch and I hope you have a great rest of your day.<br/>Best,<br/><br/>-John<br/><br/>PS-I\'ll be in meetings until later tonight but will definitely add you on Skype before our meeting. My Skype name is:<br/>SingletaryJ472',0,0,0,'2017-02-16 23:33:36',NULL),(2052,0,'ACoAAAUuJ9YBYmt7FOh03jIqIaC084KYVdpzIyo','6318077924595634176','I6318078262585233409_500',1,'Just had a look at the web site. A question: do you accept photos to publish, or are photographers free to upload? I see a lot of HDR-like stuff and not sure if that\'s where I fit in... Thanks.',0,0,0,'2017-09-25 13:47:20',NULL),(2053,1,'ACoAAB_Ft5IB5MLrqHMAz9KrPy8otN8wTyhmpOs','6238248785227710464','S6238248785227710464_500',0,'Hi, I\'m Karina the director of partnerships at YouPic, a community of 1.5 million photographers worldwide. I would like to open up a discussion with you regarding partnership with you. <br/><br/>Let me know if you are interested. <br/><br/><br/><br/>Yours, Karina',0,0,1,'2017-02-17 06:53:29',NULL),(2054,1,'ACoAAB_Ft5IB5MLrqHMAz9KrPy8otN8wTyhmpOs','6238248785227710464','S6238283720286146560_500',0,'We are looking for a few ambassadors in their respective fields and offer mutual beneficial relationship as partner with YouPic. <br/><br/>Today we are sharing the knowledge of photography, connecting professionals with enthusiast and making it possible for professionals to gain customers and exposure. I suggest we customise the partnership based on your special demand and needs at the moment. Basically we will have you featured on our website and apps and wil