tography that I am looking to book for.<br/><br/>As a side note, I think it would be very beneficial to make it more of a creative social media. The platform is there. It would simply be a matter integrating a few additional features. Model Mayhem has lost the battle for respect when it comes to being a useful tool for creatives to link up. MM is essentially a glorified Craigslist now. There is a void in that market. Your template and existing customer base presents a huge opportunity to kick the door down in that sector.  All you\'d have to do to filter out fakes is to  force users to provide legitimate creative credentials (Facebook Page, Portfolio, References, etc.)<br/><br/>I would love to discuss more with you and YouPic seems like a cool place. <br/><br/>Regards,<br/><br/>Chris Petry',0,0,0,'2017-02-15 01:10:34',NULL),(2211,1,'ACoAAAHa6awBUXXxW1HP3xjt9RUS-asJgUWLSig','6237267319031152640','S6237557942942560256_500',0,'Wow dear Chris. This was some very insightful and smart feedback. I think it would be good if I connected you directly with our CEO as I think he would love to learn more from your experiences and see how we can iterate YouPic to make it better. Do you have any email adress I can forward to him? Also please send me your YouPic Link... Yours, Karina.',0,0,1,'2017-02-15 09:08:19',NULL),(2212,1,'ACoAAAWPZy0Bzr5qiHLNT7edrSo_vxUspCQdV3s','6237661117565542400','S6237661117565542400_500',0,'Hi, I\'m Karina the director of partnerships at YouPic, a community of 1,5 million photographers worldwide. I would like to open up a discussion with you regarding partnership with you. <br/><br/><br/><br/>Let me know if you are interested. <br/><br/><br/><br/>Yours, Karina',0,0,1,'2017-02-15 15:58:18',NULL),(2213,1,'ACoAAAWPZy0Bzr5qiHLNT7edrSo_vxUspCQdV3s','6237661117565542400','S6237663235902926848_500',0,'Super cool Rob... We are doing some interesting features at YouPic regarding sharing the knowledge of photography, connecting professionals with enthusiast and m